import React, { Component } from 'react'
import { MDBCol, MDBRow } from 'mdbreact';
import "../index.css";

export default class resumenFinal extends Component {
  render() {
    return (
      <div>
        <MDBRow center>
          <MDBCol id="primary" center md="8">
            <p className="h2">Resumen de Compra</p>
          </MDBCol>
        </MDBRow>
      </div>
    )
  }
}
